import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import BackButton from './../../components/BackButton.js'
import './Design.css';

import afx2020 from './../../assets/afx-2020-large.png'

function Design() {
  return (
      <div className="Design">
          <div className="Text">
              <div>
                  I have included a couple of case studies involving my most recent design projects below. Click on any one of them to find out more information!
              </div>
              <div>
                  <a href="design">
                      <img className="Image" src={afx2020} />
                  </a>
              </div>
          </div>

      </div>
  );
}

export default Design;
